const hover=(()=>{var e=document.getElementsByClassName("grid-wrapper");e[0].addEventListener("mouseover",e=>{const t=e.target.parentNode.lastChild;"grid-title"===t.className&&(t.style.opacity="1")}),e[0].addEventListener("mouseout",e=>{const t=e.target.parentNode.lastChild;"grid-title"===t.className&&(t.style.opacity="0")})})();